    <script>
        var tooltipSpan = document.getElementById('details-box');
        document.addEventListener('mouseover', function(e) {
            if (e.target.tagName == 'path') {
                var content = e.target.dataset.name;
                document.getElementById("details-box").innerHTML = content;
                document.getElementById("details-box").style.opacity = "100%";
            } else {
                document.getElementById("details-box").style.opacity = "0%";
            }
        });
        window.onmouseover = function(e) {
            var x = e.clientX;
            y = e.clientY;
            tooltipSpan.style.top = (y + 20) + 'px';
            tooltipSpan.style.left = (x) + 'px';
        };
    </script>

    <script>
        function showMapData(title) {
            console.log(title);
            fetch("startup_data.json")
                .then(response => response.json())
                .then(data => {
                    for (var i in data) {
                        if (data[i].title == title) {
                            document.querySelector(".title").innerHTML = data[i].title;
                            document.querySelector(".scount").innerHTML = data[i].startups;
                            document.querySelector(".icount").innerHTML = data[i].investors;
                            document.querySelector(".mcount").innerHTML = data[i].mentors;
                        }

                        // console.log(data[i]);


                    }



                })

        }
    </script>
    <!--For AutoSelect City-->
    <script>
        // var ID = 0;
        const districts = ["ahmadnagar", "akola", "amaravathi", "aurangabad", "beed", "bhandara", "buldhana", "chandrapur", "dhule", "gadchiroli", "gondia", "hingoli", "jalgaon", "jalna", "kolhapur",
            "latur", "mumbai", "nagpur", "nanded", "nandurbar", "nashik", "parbhani", "pune", "raigad", "ratnagiri", "sangli", "satara", "sindudurg", "solapur", "thane", "wardha",
            "washim", "usmanabad", "yavatmal"
        ];
        const new_districts = [
            ".ahmadnagar", ".akola", ".amaravathi", ".aurangabad", ".beed", ".bhandara", ".buldhana", ".chandrapur", ".dhule", ".gadchiroli", ".gondia", ".hingoli", ".jalgaon", ".jalna", ".kolhapur",
            ".latur", ".mumbai", ".nagpur", ".nanded", ".nandurbar", ".nashik", ".parbhani", ".pune", ".raigad", ".ratnagiri", ".sangli", ".satara", ".sindudurg", ".solapur", ".thane", ".wardha",
            ".washim", ".usmanabad", ".yavatmal"
        ];

        var i = 0;

        function stroke() {
            document.querySelector(new_districts[i]).style.strokeWidth = '9';
            document.querySelector(new_districts[i]).style.stroke = 'black';
            document.querySelector(new_districts[i]).style.fill = 'mediumseagreen';
        }
        var j = 0

        function strokeout() {
            document.querySelector(new_districts[j]).style.strokeWidth = '3';
            document.querySelector(new_districts[j]).style.stroke = '#e27c39';
            document.querySelector(new_districts[j]).style.fill = '#FEFEE9';
        }


        var i = 0;

        function select() {
            showMapData(districts[i]);
            stroke(new_districts[i]);
            i++;
        }

        function new_select() {
            strokeout(new_districts[j]);
            j++;
        }

        function step() {
            for (var i = 1; i < 200; i++) {
                ID = window.setTimeout(new_select, ((5000 * i) + 5000));
            }
        }

        function auto() {
            ID = window.setInterval(select, 5000);
            ID = window.setTimeout(step, 0);
        }
    </script>
